import React, { useState } from "react";
import "./LogEntryForm.css";
import { useForm } from "react-hook-form";
import { createLogEntry } from "./API";

const LogEntryForm = ({ addEntryLocation }) => {
  const [commentInput, setCommentInput] = useState("");
  const { register, handleSubmit } = useForm();

  const onSubmit = async (data) => {
    try {
      data.latitude = addEntryLocation.latitude;
      data.longitude = addEntryLocation.longitude;
      const created = createLogEntry(data);
      console.log(data);
    } catch (error) {}
  };

  return (
    <form onSubmit={handleSubmit(onSubmit)} className="entry-form">
      <label for="title">Title</label>
      <input name="title" required ref={register}></input>
      <label for="comments">Comments</label>
      <textarea name="comments" rows={3} ref={register}></textarea>
      <label for="description">Description</label>
      <textarea name="description" rows={3} ref={register}></textarea>
      <label for="image">Image</label>
      <input name="image" ref={register}></input>
      <label for="visitDate">VisitDate</label>
      <input name="visitDate" type="date" ref={register}></input>
      <button type="submit" onClick={"some funcion"}>
        save location
      </button>
    </form>
  );
};

export default LogEntryForm;
